def from_txt_to_dict(check_this_dict):    level_dict = {}    with open('levels/level1.txt', 'r', encoding='utf8') as level1:        for index, row in enumerate(level1):            level_dict[index] = row.rstrip('\n').split(',')    fl = False    for i in range(len(check_this_dict)):        if check_this_dict[i] == level_dict[i]:            fl = True        else:            fl = False            break    return fl# check_this_dict = {0: ['0', ' 1', ' 0'], 1: ['1', ' 1', ' 0'], 2: ['0', ' 1', ' 0']}# print(from_txt_to_dict(check_this_dict))